const defaultPerson = [{ id: 0, name: 'Ernest', age: 13 }]
export default function person(preState = defaultPerson, action) {
  console.log('gg');
  const { type, data } = action
  switch (type) {
    case 'add':
      return [...preState, data]
    default:
      return preState
  }
}
